import React, { Component } from 'react'
import { Table, Divider, Tag } from 'antd';


const columns = [
    {
        title: '销售类型',
        dataIndex: 'key',
        key: 'key',
        // render: text => <a>{text}</a>,
    },
    {
        title: '销售作物',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: '销售时间',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: '销售产量',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: '销售价格',
        dataIndex: 'address',
        key: 'address',
    }
    ]

const data = [
    {
        types: '粮食作物',
        product: '',
        time: '',
        yield: '',
        price: ['nice', 'developer'],
    }
]
class Sell extends Component{
    render(){
        return(
            <div className='APP'>
                <Table columns={columns} data={data}>
                </Table>
            </div>
        )
    }
}
export default Sell
